import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import bridge from '@vkontakte/vk-bridge'
import App from './App';

bridge.send("VKWebAppInit");
ReactDOM.render(
  <ConfigProvider>
    <AdaptivityProvider>
      <App />
    </AdaptivityProvider>
  </ConfigProvider>,
  document.getElementById("root")
);
